import React from 'react';
import '../style/Header.css';
import Card from "react-bootstrap/Card";


const Weatheroutput = ({ description, city,  error, temperature,country,temperaturemin,temperaturemax }) => {
    return (
        <div className="WeaOutput">
            <Card className="bg-info text-dark  card ">
                <Card.Title className="text-center" >Weather of your city </Card.Title>
                <Card.Text>
                    <div>
                        <p className="name">{city && <p>{city}</p>},{country && <p>{country}</p>}</p>
                        <p className="temp">{temperature && <p>{temperature}</p>}</p>
                        <p className="max_tem"></p>
                        <p className="min_temp"></p>
                        <p className="humidity"></p>
                        <p className="wind_speed"></p>
                        <p className="desc"></p>
                  </div>



                    {temperaturemin && <p>{temperaturemin}</p>}
                    {temperaturemax && <p>{temperaturemax}</p>} 
                    {description && <p> {description}</p>}
                    {error && <p>{error}</p>}
                </Card.Text>
            </Card>



        </div>
    )
}

export default Weatheroutput;
